import React from 'react'
import s from './Footer.module.css'
import { useNavigate } from 'react-router-dom';

const Footer1 = (props) => {
    let link = ''
    let link2 = ''
    if(props.hist['*'] === 'Sponsors/QulixSystems') link = 'https://www.qulix.com/'
    if(props.hist['*'] === 'Sponsors/Yandex') link = 'https://yandex.by/'

    const navigte = useNavigate();


    return (
        <div className={s.Footer}>
            <a className={s.Button1} href={link}><span className={s.lable}>Сайт компании</span></a>
            <div className={s.Button2} onClick={() => navigte(link2)}><span className={s.lable}>Информация о направлении</span></div>
        </div>
    );
}


export default Footer1;
